webpackJsonp([0x7313823b55c8],{464:function(e,a){e.exports={data:{site:{siteMetadata:{title:"Blog by Michael Lancaster",subtitle:"Software Engineer focused in Javascript applications",copyright:"© All rights reserved.",author:{name:"Michael Lancaster",twitter:"weblancaster"},url:"http://www.bymichaellancaster.com"}},markdownRemark:{id:"/Users/michaellancaster/Sites/github/michaellancaster-blog/src/pages/articles/2014-06-19-soundcloud-for-desktop-win-mac-released-soundnode-app/index.md absPath of file >>> MarkdownRemark",html:'<p>Soundnode App - The Soundcloud for desktop beta released!</p>\n<p>That being said you download the best version to your computer <a href="http://www.soundnodeapp.com" target="_blank" title="Soundnode App - Soundcloud for desktop">here</a> and <strong>out of the box</strong> click, authenticate your user and start to listen to songs.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/soundenode-0-1-0-72d16a7fbec59848f1775f7380a049fe-b75c7.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 960px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 63.701578192252505%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Soundnode App - The Soundcloud for desktop beta released!"\n        title=""\n        src="/static/soundenode-0-1-0-72d16a7fbec59848f1775f7380a049fe-c83f1.png"\n        srcset="/static/soundenode-0-1-0-72d16a7fbec59848f1775f7380a049fe-569e3.png 240w,\n/static/soundenode-0-1-0-72d16a7fbec59848f1775f7380a049fe-93400.png 480w,\n/static/soundenode-0-1-0-72d16a7fbec59848f1775f7380a049fe-c83f1.png 960w,\n/static/soundenode-0-1-0-72d16a7fbec59848f1775f7380a049fe-b75c7.png 1394w"\n        sizes="(max-width: 960px) 100vw, 960px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h2>Current Features</h2>\n<ul>\n<li>Search</li>\n<li>Keyboard shortcuts (not native for this release)\nPlay/Pause <code class="language-text">command+return</code> or <code class="language-text">space</code>, Prev <code class="language-text">command+left</code>, Next <code class="language-text">command+right</code>, Volume down <code class="language-text">command+down</code>, Volume up <code class="language-text">command+up</code>, Cheat-sheet <code class="language-text">shift+?</code> (ps: use ctrl for Windows/PC user)</li>\n<li>Listen to songs from your Streams, Likes, Tracks or Playlists</li>\n<li>Automatic update available notification</li>\n</ul>\n<p>There’s still known minor bugs which you can track on the <a href="https://github.com/Soundnode/soundnode-app/issues" target="_blank" title="Soundnode App issues list">issues list</a> <br>\nand lots of features to come.</p>\n<p>Cheers!</p>',fields:{date:"2014-06-19"},frontmatter:{title:"Soundnode App - Soundcloud for desktop released",description:"Soundnode App - The Soundcloud for desktop beta released!"}}},pathContext:{slug:"/articles/2014-06-19-soundcloud-for-desktop-win-mac-released-soundnode-app/"}}}});
